hen they click on unlocking URL ({unlock_url}) inserted in newsletters and welcome message.'=>'URL, an die Abonnenten weitergeleitet werden, wenn sie auf die URL zum Freischalten ({unlock_url}) klicken, die in den Newslettern und der Willkommensnachricht eingefügt ist.','WordPress users processed'=>'WordPress-Benutzer verarbeitet','subscriptions added'=>'abonnements hinzugefügt','subscribers linked'=>'abonnenten verbunden','Checkbox label'=>'Beschriftung des Kontrollkästchens','Subscribe as'=>'Abonnieren als','Send welcome email'=>'Willkommens-E-Mail senden','Subscription delete'=>'Abonnement löschen','Import already registered users'=>'Bereits registrierte Benutzer importieren','Import with status'=>'Import mit Status','Please, carefully read the documentation before taking this action!'=>'Lesen Sie bitte zuerst die Dokumentation, bevor Sie hier weiter machen!','Link subscribers with users by email'=>'Abonnenten mit Nutzern per E-Mail verbinden','Link'=>'Link','Log level'=>'Log-Level','Subscribe to our newsletter'=>'Unseren Newsletter abonnieren','Go'=>'Weiter','item(s) found'=>'gefundene(r) Gegenstand(e)','Edit Automated Channel'=>'Automatisierten Kanal bearbeiten','Automated Template'=>'Automatisierte Vorlage','Automated Newsletters'=>'Automatisierte Newsletters','Automated Index'=>'Automatisierter Index','Automatischer Newsletter'=>'Automatischer Newsletter','Speichern'=>'Speichern','Automated channels allow you to send newsletters automatically based on your own schedule and content sources. Create, configure and manage recurring campaigns for your subscribers with just a few clicks.'=>'Mit automatisierten Kanälen kannst du Newsletter automatisch auf der Grundlage deines eigenen Zeitplans und deiner Inhaltsquellen versenden. Erstelle, konfiguriere und verwalte wiederkehrende Kampagnen für deine Abonnenten mit nur wenigen Klicks.','New channel'=>'Nuovo canale','Id'=>'ID','Last newsletter'=>'Letzter Newsletter','Vorlage gespeichert.'=>'Vorlage gespeichert.','Edit Autoresponder Series'=>'Autoresponder-Serien bearbeiten','Autoresponder Subscribers'=>'Autoresponder-Abonnenten','Autoresponder Statistics'=>'Autoresponder-Statistiken','Autoresponder Messages'=>'Autoresponder-Nachrichten','Autoresponder Composer'=>'Autoresponder Composer','E-Mail gespeichert.'=>'E-Mail gespeichert.','Weiter'=>'Weiter','Delay (hours)'=>'Verzögerung (Stunden)','Wie viele Stunden nach Start oder nach der vorherigen E-Mail soll diese E-Mail versendet werden?'=>'Wie viele Stunden nach Start oder nach der vorherigen E-Mail soll diese E-Mail versendet werden?','Here you can configure the autoresponder settings. Define activation rules, select the subscriber list, set language filters, and adjust advanced options for your automated email series.'=>'Hier kannst du die Autoresponder-Einstellungen konfigurieren. Lege Aktivierungsregeln fest, wähle die Abonnentenliste aus, setze Sprachfilter und passe erweiterte Optionen für deine automatisierten E-Mail-Serien an.','Activation rules'=>'Aktivierungsregeln','When disabled the series can anyway be activated by addons, custom subscription forms, and so on.'=>'Wenn sie deaktiviert ist, kann die Serie trotzdem durch Addons, benutzerdefinierte Anmeldeformulare usw. aktiviert werden.','List set'=>'Listensatz','the series is activated to subscribers in the specified list. Subscribers are automatically captured when they enter the list and automatically released when they exit the list (usually within 5 minutes).'=>'wird die Serie für die Abonnenten in der angegebenen Liste aktiviert. Die Abonnenten werden automatisch erfasst, wenn sie die Liste betreten, und automatisch freigegeben, wenn sie die Liste verlassen (normalerweise innerhalb von 5 Minuten).','Keep active'=>'Aktiv bleiben','Keep the series active if the subscriber is removed from the list, otherwise stop it.'=>'Lass die Serie aktiv, wenn der Abonnent aus der Liste entfernt wird, ansonsten stoppe sie.','Only subscribers with a matching language will be linked