ubscription and Edit page creation'=>'Erstellung von Abonnements und Bearbeitungsseiten','We\'ve just created the page where your visitors will subscribe and where they will edit their preferences.'=>'Wir haben gerade die Seite erstellt, auf der sich Ihre Besucher anmelden und auf der sie ihre Präferenzen bearbeiten werden.','Time for some tests!'=>'Zeit für ein paar Tests!','Check if your website can send emails correctly.'=>'Prüfen Sie, ob Ihre Website Emails korrekt versenden kann.','Email address'=>'E-Mail-Adresse','Send a test message'=>'Senden einer Testnachricht','Add Newsletter widget to sidebar'=>'Fügen Sie das Newsletter-Widget in die Sidebar ein','If you use sidebars in your blog, it may be a good idea to add a subscription form there. Remember to come back here when you\'re done'=>'Falls Sie Sidebars in Ihrer Webseite verwenden, wäre es vielleicht eine gute Idee, dort ein Anmeldeformular zu platzieren. Vergessen Sie nicht, hierher zurück zu kommen, sobald Sie fertig sind','Take me to my widget settings (opens in a new window)'=>'Bringe mich zu den Widget-Einstellungen (öffnet in einem neuen Fenster)','You\'re now ready to begin using Newsletter!'=>'Sie können nun Newsletter verwenden!','Go to your dashboard'=>'Gehen Sie zu Ihrem Dashboard','Labels'=>'Beschriftungen','Page'=>'Seite','Page content'=>'Seiteninhalt','Content of the Newsletter public page'=>'Inhalt der öffentlichen Seite des Newsletters','Notes'=>'Notizen','Use'=>'Nutzung','where you want the edit form to be inserted.'=>'wo das Bearbeitungsformular eingefügt werden soll.','to add the unsubscribe button.'=>'um die Schaltfläche zum Abbestellen hinzuzufügen.','to add the GDPR export button.'=>'um die GDPR-Export-Schaltfläche hinzuzufügen.','Field'=>'Feld','Required'=>'Erforderlich','Profile saved'=>'Profil gespeichert','Email changed alert'=>'E-Mail geänderte Warnung','General error'=>'Allgemeiner Fehler','"Save" label'=>'Bezeichnung "Speichern"','Privacy link text'=>'Datenschutz Link Text','Profile'=>'Profil','Newsletter custom profile page, keep public and published'=>'Newsletter benutzerdefinierte Profilseite, öffentlich und veröffentlicht halten','Export your data'=>'Exportieren Sie Ihre Daten','Profile edit'=>'Profil bearbeiten','Subscriber not found or not confirmed or started from a test newsletter.'=>'Abonnent nicht gefunden oder nicht bestätigt oder aus einem Test-Newsletter gestartet.','Subscriber not found.'=>'Abonnent:in nicht gefunden.','Select language'=>'Sprache wählen','View details'=>'Details anzeigen','More information about %s'=>'Mehr Informationen über %s','Check for updates'=>'Auf Aktualisierungen prüfen','the plugin title' . "\4" . 'The %s plugin is up to date.'=>'Das %s Plugin ist aktuell.','the plugin title' . "\4" . 'A new version of the %s plugin is available.'=>'Eine neue Version des Plugins %s ist verfügbar.','the plugin title' . "\4" . 'Could not determine if updates are available for %s.'=>'Konnte nicht prüfen, ob Updates für das Plugin %s verfügbar sind.','Unknown update checker status "%s"'=>'Unbekannter Status für Aktualisierungscheck "%s"','There is no changelog available.'=>'Es steht kein Änderungsprotokoll zur Verfügung.','No newsletters have been sent till now'=>'Bisher wurden keine Newsletter verschickt','Overall basic statistics (last 20 newsletters)'=>'Grundlegende Statistiken insgesamt (letzte 20 Newsletter)','Full report'=>'Vollständiger Bericht','Subscriber not found'=>'Abonnent nicht gefunden','Clicked URLs'=>'Angeklickte URLs','Clicks'=>'Klicks','Who clicked...'=>'Wer geklickt hat...','No clicks recorded for this newsletter.'=>'Für diesen Newsletter wurden keine Klicks registriert.','Add to this list'=>'Zu dieser Liste hinzufügen','Draft newsletter, no data available'=>'Newsletter-Entwurf, keine Daten verfügbar','Newsletter still sending'=>'Newsletter noch verschickt','This newsletter has the tracking disabled. No statistics will be available.'=>'Für diesen Newsletter ist die Nachverfolgung deaktiviert. Es werden keine Statistiken verfügbar sein.','Reach'=>'Reichweite','Total people that got your email'=>'Anzahl der Personen, die deine E-Mail erhalten haben','Opens'=>'Öffnet','total people that opened your email'=>'anzahl der Personen, die deine E-Mail geöffnet haben','total people that clicked a link in your email'=>'anzahl der Personen, die auf einen Link in deiner E-Mail geklickt haben','Reactivity'=>'Reaktivität','clicks out of'=>'klickt aus','opens'=>'Öffnungen','Blacklists'=>'Blacklists','Disable'=>'Deaktivieren','Sends the subscription data to Akismet to know if it\'s spam'=>'Sendet die Anmeldedaten an Akismet, um festzustellen, ob es sich um Spam handelt','Antiflood'=>'Antiflood','seconds'=>'Sekunden','minute'=>'Minute','minutes'=>'Minuten','Refuses repeated subscription from the same IP or for the same address by the specified interval.'=>'Verweigert wiederholte Abonnements von derselben IP oder für dieselbe Adresse nach dem angegebenen Intervall.','Captcha'=>'Captcha','Shown after the form submission as a confirmation step'=>'Wird nach dem Absenden des Formulars als Bestätigungsschritt angezeigt','Address blacklist'=>'Schwarze Liste für Adressen','Confirmation page'=>'Bestätigungsseite','Customize'=>'Anpassen','Composer'=>'Komponist','Public'=>'Öffentlich','Optional'=>'Optional','Name/Label'=>'Name/Label','Placeholder'=>'Platzhalter','Rule'=>'Regel','List values comma separated'=>'Werte kommagetrennt auflisten','Main fields'=>'Hauptfelder','Option labels'=>'Optionslabel','Privacy'=>'Datenschutz','Enabled?'=>'Aktiviert?','Only the notice'=>'Nur der Hinweis','Label'=>'Label','The "all language" setting is set to use the ClassicPress default privacy page. Please translate that page.'=>'Die Einstellung "alle Sprachen" ist so eingestellt, dass die ClassicPress-Standardseite für den Datenschutz verwendet wird. Bitte übersetze diese Seite.','Use ClassicPress privacy URL'=>'ClassicPress Datenschutz-URL verwenden','To use the ClassicPress privacy page, switch to "all lang